import React from 'react'
import { Button } from 'reactstrap'

const WeatherForm = ({ city, addCity, setCity }) => {
  return (
    <div>
      <input
        type="text"
        placeholder="Název města"
        className="m-3"
        onChange={setCity}
        value={city}
      />
      <Button onClick={() => addCity(city)}>Přidat město</Button>
    </div>
  )
}

export default WeatherForm
